import Foundation

/*
 340. Longest Substring with At Most K Distinct Characters
 
 Given a string, find the length of the longest substring T that contains at most k distinct characters.

 Example 1:

 Input: s = "eceba", k = 2
 Output: 3
 Explanation: T is "ece" which its length is 3.
 Example 2:

 Input: s = "aa", k = 1
 Output: 2
 Explanation: T is "aa" which its length is 2.
 
 Input: s = "araaci", k=2
 Output = 4

 Input: s = "cbbebi", k=3
 Output = 5

 */

class Input_340 {
    func executeInput() {
        let s = ""
        let k = 2
        print(lengthOfLongestSubstringKDistinct(s, k))
    }
}

extension Input_340 {
    
    // LOGIC
    // Iterate over the String
    // For each character visited, update the scannerDict with character being visited as the key and number of occurences as value
    // After updating the scannerDict, check number of keys, if it is <= k, update maxLengthSoFar
    // If number of keys in scannerDict in the above step is > k, remove/ reduce count of occurences of character occuring at sliding window start, move start by 1 index
    func lengthOfLongestSubstringKDistinct(_ s: String, _ k: Int) -> Int {
        var maxLengthSoFar = 0
        var scannerDict = [Character : Int]()
        var slidingWindowStartIdx = 0
        var slidingWindowEndIdx = 0
        
        for currAlphabet in s {
            
            // Update the scannerDict with character index being visited
            scannerDict[currAlphabet] = slidingWindowEndIdx
            slidingWindowEndIdx += 1
            
            // If number of keys in scannerDict is <= k, update maxLengthSoFar
            if scannerDict.keys.count <= k && (slidingWindowEndIdx - slidingWindowStartIdx > maxLengthSoFar) {
                maxLengthSoFar = slidingWindowEndIdx - slidingWindowStartIdx
            }
            // we have more keys in scannerDict than allowed, move slidingWindow to right one step at a time, and remove the key going out of the window, until number keys allowed become equal to allowed limit
            while scannerDict.keys.count > k {
                if let minValueElement = scannerDict.first(where: { $0.value == scannerDict.values.min() }) {
                    slidingWindowStartIdx = minValueElement.value + 1
                    scannerDict.removeValue(forKey: minValueElement.key)
                }
            }
        }
        return maxLengthSoFar
    }
    
    func lengthOfLongestSubstringKDistinct_Non_efficient(_ s: String, _ k: Int) -> Int {
        var maxLengthSoFar = 0
        var scannerDict = [Character : Int]()
        var slidingWindowStartIdx = 0
        
        for currAlphabet in s {
            
            // Update the scannerDict with character being visited
            if scannerDict.contains(where: { (key, _) in
                return key == currAlphabet
            }) {
                scannerDict[currAlphabet] = scannerDict[currAlphabet]! + 1
            } else {
                scannerDict[currAlphabet] = 1
            }
            
            // If number of keys in scannerDict is <= k, update maxLengthSoFar
            if scannerDict.keys.count <= k && scannerDict.values.reduce(0, +) > maxLengthSoFar {
                maxLengthSoFar = scannerDict.values.reduce(0, +)
            }
            // we have more keys in scannerDict than allowed, move slidingWindow to right one step at a time, and remove the key going out of the window, until number keys allowed become equal to allowed limit
            while scannerDict.keys.count > k {
                let characterGoingOut = Array(s)[slidingWindowStartIdx]
                if scannerDict.contains(where: { (key, _)  in
                    return key == characterGoingOut
                }) {
                    scannerDict[characterGoingOut] = scannerDict[characterGoingOut]! - 1
                    if scannerDict[characterGoingOut]! <= 0 {
                        scannerDict.removeValue(forKey: characterGoingOut)
                    }
                    slidingWindowStartIdx += 1
                }
            }
        }
        
        return maxLengthSoFar
    }
}
